DROP DATABASE IF EXISTS profiles;

CREATE DATABASE profiles;

USE profiles;

CREATE TABLE profile_data (
  user_id int NOT NULL AUTO_INCREMENT,
  first_name varchar(10) NOT NULL,
  last_name varchar(10) NOT NULL,
  email varchar(30) NOT NULL,
  location varchar(30) NOT NULL,
  date_joined date,
  bio varchar(300) NOT NULL,
  photo_url varchar(30) NOT NULL,
  pro boolean,
  PRIMARY KEY (ID)
);

CREATE TABLE activities (
  activity_id int NOT NULL AUTO_INCREMENT,
  activity_name varchar(10) NOT NULL,
  PRIMARY KEY (ID)
);

CREATE TABLE activities_user (
  user_id int NOT NULL,
  activity_name varchar(10) NOT NULL,
  PRIMARY KEY (user_id, activity_name)
);


/*  Execute this file from the command line by typing:
 *    mysql -u <USER> < schema.sql
 *    OR
 *    mysql -u <USER> -p < schema.sql
 *  For example, on a pairing station, it'll be 
 *    mysql -u student -p < schema.sql
 *  and then you'll have to enter the password, student
 *  On your personal computer, if you haven't set up
 *  a password, it'll be 
 *    mysql -u root < schema.sql
*/

